import React, { useEffect, useState } from 'react';
import { api } from '../services/api';
import '../styles/AccessRequests.css';

function AccessRequests() {
  const [requests, setRequests] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [success, setSuccess] = useState(null);

  useEffect(() => {
    fetchRequests();
  }, []);

  const fetchRequests = async () => {
    try {
      const data = await api.getAccessRequests();
      setRequests(data);
      setLoading(false);
    } catch (err) {
      console.error('Error fetching access requests:', err);
      setError('Failed to fetch access requests');
      setLoading(false);
    }
  };

  const handleApprove = async (requestId) => {
    try {
      await api.updateAccessRequest(requestId, 'approved');
      setRequests(requests.map(request => 
        request.request_id === requestId 
          ? { ...request, status: 'approved' }
          : request
      ));
      setSuccess('Access request approved successfully');
      setTimeout(() => setSuccess(null), 3000);
    } catch (err) {
      setError('Failed to approve request. Please try again.');
    }
  };

  const handleDeny = async (requestId) => {
    try {
      await api.updateAccessRequest(requestId, 'denied');
      setRequests(requests.map(request => 
        request.request_id === requestId 
          ? { ...request, status: 'denied' }
          : request
      ));
      setSuccess('Access request denied');
      setTimeout(() => setSuccess(null), 3000);
    } catch (err) {
      setError('Failed to deny request. Please try again.');
    }
  };

  if (loading) return <div className="loading">Loading access requests...</div>;

  return (
    <div className="access-requests-container">
      <div className="access-requests-header">
        <h3>Access Requests</h3>
        {error && <div className="error-message">{error}</div>}
        {success && <div className="success-message">{success}</div>}
      </div>

      <div className="requests-table-container">
        <table>
          <thead>
            <tr>
              <th>User</th>
              <th>Application</th>
              <th>Reason</th>
              <th>Requested At</th>
              <th>Status</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {requests.map((request) => (
              <tr key={request.request_id} className={`request-row ${request.status}`}>
                <td>{request.username}</td>
                <td>{request.app_name}</td>
                <td>{request.reason}</td>
                <td>{new Date(request.requested_at).toLocaleString()}</td>
                <td>
                  <span className={`status-badge ${request.status}`}>
                    {request.status.charAt(0).toUpperCase() + request.status.slice(1)}
                  </span>
                </td>
                <td>
                  {request.status === 'pending' && (
                    <div className="request-actions">
                      <button 
                        className="approve-button"
                        onClick={() => handleApprove(request.request_id)}
                      >
                        Approve
                      </button>
                      <button 
                        className="deny-button"
                        onClick={() => handleDeny(request.request_id)}
                      >
                        Deny
                      </button>
                    </div>
                  )}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default AccessRequests;
